              name: "Feddit.it",
              sidebar:
                "#### Cos'è Fedd**it**\nFedd**it** è l'alternativa italiana a Reddit, basata sul software [Lemmy](https://www.lealternative.net/2022/04/06/cose-lemmy/), uno dei progetti più interessanti del [fediverso](https://framatube.org/w/9dRFC6Ya11NCVeYKn8ZhiD?subtitle=it).\n\n#### Informazioni\nQuesto server di **Lemmy** è gestito da [Poliverso](https://poliverso.org/) e [Le Alternative](https://www.lealternative.net/).\n\n#### Regole\n\n🇮🇹 In questo server è necessario scrivere principalmente utilizzando la lingua italiana.\n\n🛎 Attualmente prima di poter aprire una comunità è necessaria l'approvazione degli amministratori [@poliverso@feddit.it](https://feddit.it/u/poliverso)  o [@skariko@feddit.it](https://feddit.it/u/skariko). Potete aprire una richiesta [cliccando qui](https://feddit.it/c/main), spiegando di cosa parlerà la comunità e come sarà gestita.\n\n📜 Ogni comunità sceglierà in autonomia le sue regole, i suoi moderatori e le sue esigenze. Non sarà tuttavia possibile aprire comunità con contenuti pornografici, illegali o con discriminazioni razziali o di genere.\n\n🚯 Le comunità politiche dovranno accettare e sottoscrivere una clausola sull'antifascismo.\n\n⛔️ Lo spam, i bot e i messaggi ripetuti o molesti saranno rimossi a prescindere dalle regole della comunità.\n\n♻️ Le comunità che non riusciranno ad auto-moderarsi verranno richiamate dagli admin e se non sarà possibile trovare una soluzione verranno eliminate.\n\n#### Come si mantiene Feddit?\n\n🧡 È un progetto indipendente e senza pubblicità, se volete potete aiutare la gestione di questo server con una piccola [donazione ricorrente su LiberaPay](https://liberapay.com/Feddit-it) oppure con una [donazione una tantum su Ko-Fi](https://ko-fi.com/fedditit).\n\nGrazie! 🧡\n\n📧 Per informazioni sull'istanza potete scrivere a lemmy@feddit.it",
