              sidebar:
                "Solarpunk imagines a world in which today’s existential threat - the climate crisis - is being approached with camaraderie and adaptive ingenuity.\n\n[What is Solarpunk?](https://solarpunkanarchists.com/2016/05/27/what-is-solarpunk/)\n\n[A SolarPunk Manifesto](https://slrpnk.net/post/236) \n\n**Rules:**\n- **be constructive**: there is no need of another internet space full of competition, negativity, rage and so on;\n- **no bigotry**, including racism, sexism, ableism, homophobia or xenophobia;\n- **be empathic**: empathy is more rebellious than a middle finger;\n- **no porn and no gore**: let's keep this place easy to manage;\n- **no ads / spamming / flooding**, we don't want to buy/consume your commodified ideas;\n- **occasional self-promotion** by active members is fine.\n\nFor any community related question or to just test some function: [!meta@slrpnk.net](https://slrpnk.net/c/meta)",
