                "E-Mail is intentionally disabled. Take good care of your password as you won't be able to reset it.\n__________________________________________________________________________\n**Verifiy you are human** by posting [this message containing your Monero.House username](https://pastebin.com/UT8TbQU6) on twitter/reddit/mastodon/etc and link the post in the answer field.\n__________________________________________________________________________\n**Alternatively** send 0.01 XMR to\n\n`85eGhq84x6KXH5zfRyCFmXbMCyikcSMcT5fRDjq8EUSr8j1zcpKW4Zq7t4fGsauzeQTrStzL3db3t2kSv9TFeXvA2vwPhex`\n\nand provide the transaction ID in the answer field. \n\nFunds are exlusively used to contribute to the hosting of this website.\n\n![](https://monero.house/pictrs/image/d71a86eb-3e1d-4772-ac7a-5ad547b01422.png) \n\n__________________________________________________________________________\nApproval usually shouldn't take long but please be patient while your account is being verified and allow up to 12 hours.",
