              sidebar:
                "\nYou can view content as:\n- All - gathered from *all places* we are federating with.\n- Subscribed - gathered only from the places *you* have subscribed to.\n- Local - gathered from *baraza* only.  \n\nCommunities in this space can take whichever direction they wish, as long as they uphold these rules:\n\n1. No bigotry -- including racism, sexism, ableism, homophobia, or xenophobia. \n2. Be respectful -- this is a safe space where everyone and their ideas should be heard, just as they are also responsible for them.\n3. Be conscious -- while the community might answer some or all of your questions, low-effort questions that can be easily searched online are a waste of everyone's time. \n4. No pornography. \n5. No ads/spamming/soliciting or providing personal details like emails or phone numbers. \n\nThis instance is powered by Lemmy, a federated link-aggregator, and is connected to Mastodon, another fediverse project. \n\nFeel free to ask questions over at the  [chat post](https://baraza.africa/post/137). ",
