              name: "Privacy Community",
              sidebar:
                "### **Welcome!**\n\nWelcome to the **NicFab Community Lemmy instance**! \\\nPlease be kind. \\\nAll communities in this space should be at least related to Privacy and innovation.\n\n### **Matrix Space**\nWe are also on Matrix Space [by clicking here](https://matrix.to/#/#privacycommunity:matrix.nicfab.it).\n\n### **Privacy Policy**\nHere you can find our [**Privacy Policy**](https://community.nicfab.it/legal).\n\n### **Code of Conduct**\nPlease abide by the [code of conduct](https://www.contributor-covenant.org/version/2/1/code_of_conduct/). \n\nTo report a CoC violation, message one of the admins.\n\n***\n\n#### Partnerships:\n- [**Lemmy.ca - Privacy**](https://lemmy.ca/c/privacy)\n\n***\n\n### **Benvenuto!**\n\nBenvenuto nella instanza Lemmy **NicFab Community**! \\\nVi invitiamo ad essere gentili. \\\nTutte le comunità in questo spazio dovrebbero essere almeno legate alla privacy e all'innovazione.\n\nQuesto è uno spazio comune per progetti e utenti interessati alla privacy, alla protezione dei dati e alle soluzioni innovative.\n\n### **Matrix Space**\nSiamo anche su Matrix Space [clicando qui](https://matrix.to/#/#privacycommunity:matrix.nicfab.it).\n\n### **Informativa Privacy**\nQui puoi trovare la nostra **[Informativa sulla privacy](https://www.nicfab.it/it/pages/ppolicy-lemmy-privacy-community/)**.\n\n### **Codice di condotta**\nSiete invitati a rispettare il [codice di condotta](https://www.contributor-covenant.org/it/version/2/0/code_of_conduct/). \n\nPer segnalare una violazione del codice di condotta, invia un messaggio a uno degli amministratori.\n\n***\n\n#### Partnerships:\n- [**Lemmy.ca - Privacy**](https://lemmy.ca/c/privacy)\n\n\n",
